import React from 'react';
import Task from './Task'; 

const List = ({ list, onEdit, onDelete }) => {
  return (
    <div>
      <h2>{list.name}</h2> 
        <button onClick={() => onDelete(list.id)}>Delete List</button>
      <div>
        {list.tasks.map(task => (
          <Task key={task.id} task={task} onEdit={onEdit} onDelete={onDelete} />
        ))}
      </div>
    </div>
  );
};

export default List;
